// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

contract RishiToken {
    string public name;
    string public symbol;
    uint256 public totalSupply;
    address public owner;

    mapping(address => uint256) public balance;

    event Burn(address indexed from, uint256 _amount);
    event Transfer(address indexed from, address indexed to, uint256 _amount);

    constructor(
        string memory _Tname,
        string memory _Tsymbol,
        uint256 _Tsupply
    ) {
        owner = msg.sender;
        name = _Tname;
        symbol = _Tsymbol;
        totalSupply = _Tsupply;
        balance[msg.sender] = _Tsupply;
    }

    // Modifier to check if the caller is the contract owner
    modifier onlyOwner() {
        require(
            msg.sender == owner,
            "You are not the owner of the contract, only owner can access it..."
        );
        _;
    }

    function mint(address to, uint256 _amount) public onlyOwner {
        require(_amount > 0, "Your amount should be greater than 0...");
        require(to != address(0), "Invalid address of recipient.....");

        balance[to] += _amount;
        totalSupply += _amount;

        emit Transfer(address(0), to, _amount);
    }

    function burn(uint256 _amount) public returns (bool) {
        require(_amount > 0, "Your amount should be greater than 0...");
        require(
            _amount <= balance[msg.sender],
            "Your balance is insufficient...."
        );

        balance[msg.sender] -= _amount;
        totalSupply -= _amount;

        emit Burn(msg.sender, _amount);
        return true;
    }

    function transfer(address to, uint256 _amount) public returns (bool) {
        require(_amount > 0, "Your amount should be greater than 0...");
        require(to != address(0), "Invalid address of recipient.....");
        require(
            _amount <= balance[msg.sender],
            "Your balance is insufficient...."
        );

        balance[msg.sender] -= _amount;
        balance[to] += _amount;

        emit Transfer(msg.sender, to, _amount);
        return true;
    }
}

